import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div className="d-flex" style={{ height: '100vh' }}>
      {/* Sidebar */}
      <nav
        className="bg-dark text-light p-3"
        style={{ width: '250px', minHeight: '100vh' }}
      >
        <h4 className="text-light mb-4">Dashboard</h4>
        <ul className="nav flex-column">
          <li className="nav-item mb-3">
            <Link to="/account" className="nav-link text-light">
              Account
            </Link>
          </li>
          <li className="nav-item mb-3">
            <Link to="/upload" className="nav-link text-light">
              Upload
            </Link>
          </li>
          <li className="nav-item mb-3">
            <Link to="/" className="nav-link text-light">
              Videos
            </Link>
          </li>
        </ul>
      </nav>

      {/* Main Content */}
      <div className="flex-grow-1 p-4 bg-secondary">
        <h2 className="text-light">Videos</h2>
        <div className="d-flex justify-content-around align-items-center mt-4">
          {[1, 2, 3, 4, 5].map((video) => (
            <div key={video} className="video-thumbnail">
              <img
                src={`https://via.placeholder.com/150?text=Video+${video}`}
                alt={`Video ${video}`}
                className="img-thumbnail rounded"
                style={{ width: '150px', height: '100px' }}
              />
              <p className="text-light mt-2 text-center">Video {video}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
